import React, { Component } from 'react'

class MobileManufacturers extends Component {
  render() {
    return (
      <div>
        <h1>Mobile Manufacturers</h1>
        <ul>
            <li className='square'>Samsung</li><li className='square'>HTC</li><li>Micromax</li><li className='circle'>Apple</li></ul>
      </div>
    )
  }
}

export default MobileManufacturers
